        name: "",
        price: "",
        image: "",
        quatity: 0
        
    })
    const [appShow, setAppShow] = useState('0');
    return (
        <div className="col-lg-4 col-md-6 col-sm-6">
            <div className="single-cat single-cat2 text-center mb-40">
                <div className="cat-img">
                    <img src="assets/img/gallery/pro-items3.jpg" alt="" />
                    <div className="numbering">{props.price}K</div>
                </div>
                <div className="cat-cap">
                    <h5><a href="#">{props.name}</a></h5>
                    <p>{props.detail} </p>
                    <a href="#" className="browse-btn" onClick={(event) => handleClickOrder(event)}>Order Now</a>
                </div>
            </div>
        </div>

    )
}
